script: |
  super -f text -I q3544.spq | sort > q3544.out

inputs:
  - name: q3544.spq
    data: |
      SELECT - - col0 - - 6 + - col2 * + col0 + + col0 * - + 44 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT CAST ( NULL AS INTEGER ) * + 10 / + col1 + - - ( - - col0 ) BETWEEN - + col1 * - 36 AND - 59 / - + col0;
  - name: tab2

outputs:
  - name: q3544.out
    data: |
